import { Component, OnInit, NgZone } from '@angular/core';
import { FormBuilder, FormGroup } from '@angular/forms';
import { Router } from '@angular/router';
import { CrudService } from 'src/app/service/crud.service';
@Component({
selector: 'app-add-house',
templateUrl: './add-house.component.html',
styleUrls: ['./add-house.component.css']
})
export class AddHouseComponent implements OnInit {
houseForm: FormGroup;
constructor(
public formBuilder: FormBuilder,
private router: Router,
private ngZone: NgZone,
private crudService: CrudService
) {
this.houseForm = this.formBuilder.group({
    year: [''],
    censustakername: [''],
    numberofpeople: [''],
    city: [''],
    state: [''],
    zip: ['']
})
}
ngOnInit(): void { }
onSubmit(): any {
this.crudService.AddHouse(this.houseForm.value)
.subscribe({
error: (err) => console.log(err)
})
this.ngZone.run(() => this.router.navigateByUrl('/houses-list'));
}
}
<div class="row justive-content-center mt-5">
    <div class="col-md-4">
    <form [formGroup]="houseForm" (ngSubmit)="onSubmit()">
    <div class="form-group">
    <label>Census Year</label>
    <input class="form-control" type="text"
    formControlName="year" required>
    </div>
    <div class="form-group">
        <label>Census Taker's Name</label>
        <input class="form-control" type="text"
        formControlName="censustakername" required>
        </div>
        <div class="form-group">
        <label># of People in House</label>
        <input class="form-control" type="text"
        formControlName="numberofpeople" required>
        </div>
        <div class="form-group">
        <label>City</label>
        <input class="form-control" type="text"
        formControlName="city" required>
        </div>
        <div class="form-group">
        <label>State</label>
        <input class="form-control" type="text"
        formControlName="state" required>
        </div>
        <div class="form-group">
        <label>Zip Code</label>
        <input class="form-control" type="text"
        formControlName="zip" required>
        </div>
        <div class="form-group">
        <button class="btn btn-primary btn-block"
        type="submit">Add House</button>
        </div>
        </form>
        </div>
        </div>
